import React, { Component } from "react";
import { TextField, Container, Button, IconButton } from "@material-ui/core";
import "../containers/LoginOrRegister.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEyeSlash, faEye } from "@fortawesome/free-solid-svg-icons";
import axios from "axios";

class Register extends Component {
  state = {
    isShowPassword: false,
    isShowConfirmPassword: false,
    firstName: "",
    lastName: "",
    phone: "",
    email: "",
    password: "",
    confirmPassword: ""
  };

  render() {
    return (
      <div className="container">
        <h3>REGISTER</h3>

        <Container>
          <TextField
            className="textFieldStyle"
            label="First name"
            margin="dense"
            variant="filled"
            value={this.state.firstName}
            onChange={event => this.setState({ firstName: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Last name"
            margin="dense"
            variant="filled"
            value={this.state.lastName}
            onChange={event => this.setState({ lastName: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Phone number"
            margin="dense"
            variant="filled"
            value={this.state.phone}
            onChange={event => this.setState({ phone: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Email"
            margin="dense"
            variant="filled"
            value={this.state.email}
            onChange={event => this.setState({ email: event.target.value })}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Passworld"
            margin="dense"
            variant="filled"
            type={this.state.isShowPassword ? "email" : "password"}
            color="white"
            value={this.state.password}
            onChange={event => this.setState({ password: event.target.value })}
            InputProps={{
              endAdornment: (
                <IconButton
                  onClick={() => {
                    this.setState({
                      isShowPassword: !this.state.isShowPassword
                    });
                  }}
                >
                  <FontAwesomeIcon
                    icon={this.state.isShowPassword ? faEye : faEyeSlash}
                  />
                </IconButton>
              )
            }}
          />
          <br />
          <TextField
            className="textFieldStyle"
            label="Confirm Passworld"
            margin="dense"
            variant="filled"
            type={this.state.isShowConfirmPassword ? "email" : "password"}
            color="white"
            value={this.state.confirmPassword}
            onChange={event =>
              this.setState({ confirmPassword: event.target.value })
            }
            InputProps={{
              endAdornment: (
                <IconButton
                  onClick={() => {
                    this.setState({
                      isShowConfirmPassword: !this.state.isShowConfirmPassword
                    });
                  }}
                >
                  <FontAwesomeIcon
                    icon={this.state.isShowConfirmPassword ? faEye : faEyeSlash}
                  />
                </IconButton>
              )
            }}
          />
          <br />
          <Button
            className="buttonStyle"
            onClick={this.handleRegister.bind(this)}
            style={{
              width: 500,
              marginTop: 50,
              background: "green",
              color: "white"
            }}
          >
            REGISTER
          </Button>
        </Container>
      </div>
    );
  }

  handleRegister() {
    isNotEmpty =
      this.state.email !== "" &&
      this.state.password !== "" &&
      this.state.firstName !== "" &&
      this.state.lastName !== "" &&
      this.state.phone !== "";
    if (isNotEmpty) {
      var user =
        "{" +
        '"firstName": ' +
        this.state.firstName +
        "," +
        '"lastName": ' +
        this.state.lastName +
        "," +
        '"phoneNumber": ' +
        this.state.phone +
        "," +
        '"email": ' +
        this.state.email +
        "," +
        '"password":' +
        this.state.password +
        "}";
      axios
        .post(`https://jsonplaceholder.typicode.com/users`, { user })
        .then(res => {
          console.log(res);
          console.log(res.data);
        });
    } else {
      alert("Enter your emai or password");
    }
  }
}

export default Register;
